INSERT INTO `BlogsEntry` VALUES ('e3092c90-e52d-07fd-8a92-529d3fdb8b7d',37384,20126,20099,20139,'Test Test','2018-10-18 13:22:14.240000','2018-10-30 19:53:37.044000','Car Insurance in Ontario: What’s Happening with Rates?',NULL,'car-insurance-in-ontario-what-s-happening-with-rates-',NULL,'<p>In Ontario, every insurance company must have changes to their auto insurance rates approved by the Financial Services Commission of Ontario (FSCO) and each quarter, FSCO publishes these rate changes. The latest rate changes have been released and, as expected, it’s not good news for Ontario drivers.</p>\n\n<p>FSCO reports that in the third quarter (Q3) of 2018, approved rates increased on average 2.06 per cent. While this increase reflects the average drivers may see upon renewal, the actual range in approved rate increases is significant: some Ontario drivers could see their rates increase 2.5 per cent, while others could see their rates increase as much as 11.6 per cent. It all depends on who you have your coverage through and the rate change your insurer has been given the green light to apply.</p>\n\n<p>Of the 20 insurers who had rate changes approved this quarter, not one lowered their rates.</p>\n\n<p>This is the fourth time in a row that rates have increased. In Q2, auto insurance rates increased 1.11 per cent on average, in Q1 they increased 2.23 per cent, and in Q4 2017 they increased 1.03 per cent. With a full year of approved rate increases on the books, it’s especially prudent that Ontario drivers heed FSCO’s advice to “shop around for auto insurance.”</p>\n\n<p>This is the fourth time in a row that rates have increased. In Q2, auto insurance rates increased 1.11 per cent on average, in Q1 they increased 2.23 per cent, and in Q4 2017 they increased 1.03 per cent. With a full year of approved rate increases on the books, it’s especially prudent that Ontario drivers heed FSCO’s advice to “shop around for auto insurance.”</p>\n\n<p>This is the fourth time in a row that rates have increased. In Q2, auto insurance rates increased 1.11 per cent on average, in Q1 they increased 2.23 per cent, and in Q4 2017 they increased 1.03 per cent. With a full year of approved rate increases on the books, it’s especially prudent that Ontario drivers heed FSCO’s advice to “shop around for auto insurance.”</p>\n\n<p>This is the fourth time in a row that rates have increased. In Q2, auto insurance rates increased 1.11 per cent on average, in Q1 they increased 2.23 per cent, and in Q4 2017 they increased 1.03 per cent. With a full year of approved rate increases on the books, it’s especially prudent that Ontario drivers heed FSCO’s advice to “shop around for auto insurance.”</p>','2018-10-18 13:21:00.000000',1,0,'',NULL,0,NULL,0,0,0,NULL,NULL,0,20139,'Victor Oliveira','2018-10-30 19:53:37.044000');
