avigation.plug(Liferay.NavigationInteraction);\n		}\n	</@>\n</#if>',0,0,24063,NULL,NULL),('624c428a-c90a-d340-fd04-b203a677eb5b',24065,20135,20099,20103,NULL,20103,NULL,'2018-09-20 18:17:07.812000','2018-09-20 18:17:07.812000',24043,0,24032,'NAVBAR-BLANK-JUSTIFIED-FTL','1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,fi_FI,zh_CN,es_ES,iw_IL,pt_BR,ja_JP,fr_FR,ca_ES,nl_NL,hu_HU,de_DE\" default-locale=\"en_US\"><Name language-id=\"fi_FI\">Palkki minimitasaustyylillä</Name><Name language-id=\"en_US\">Bar minimally justified styled</Name><Name language-id=\"zh_CN\">导航栏最小化两端对齐样式</Name><Name language-id=\"es_ES\">Barra con estilo justificado mínimo</Name><Name language-id=\"iw_IL\">סרגל מעוצב מוצמד קלות</Name><Name language-id=\"pt_BR\">Barra minimamente justificada estilizada</Name><Name language-id=\"ja_JP\">最小等幅バー形式</Name><Name language-id=\"fr_FR\">Barre minimaliste et justifiée</Name><Name language-id=\"ca_ES\">Barra amb justificació i estil mínims</Name><Name language-id=\"nl_NL\">Uitgevulde minimalistische balk</Name><Name language-id=\"hu_HU\">Minimálisan sorkizárt stílusú oszlop</Name><Name language-id=\"de_DE\">Minimalistische justierte Leiste</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,fi_FI,zh_CN,es_ES,iw_IL,pt_BR,ja_JP,fr_FR,ca_ES,nl_NL,hu_HU,de_DE\" default-locale=\"en_US\"><Description language-id=\"fi_FI\">Näyttää navigointivalikon minimalistisesti tasatusti tyylitellyllä navigointipalkilla.</Description><Description language-id=\"en_US\">Displays a navigation menu with a minimally justified styled navigation bar.</Description><Description language-id=\"zh_CN\">显示带有最小化两端对齐样式导航栏的导航菜单。</Description><Description language-id=\"es_ES\">Muestra un menú de navegación con una barra de navegación con un estilo justificado mínimamente.</Description><Description language-id=\"iw_IL\">מציג תפריט ניווט עם סרגל ניווט מעוצב מוצמד קלות.</Description><Description language-id=\"pt_BR\">Exibe um men