rvice(\"com.liferay.portal.kernel.service.UserLocalService\")\n\n												entryUser = userLocalService.fetchUser(curBlogEntry.getUserId())\n											/>\n\n											<#if entryUser?? && !entryUser.isDefaultUser()>\n												<#assign entryUserURL = entryUser.getDisplayURL(themeDisplay) />\n											</#if>\n										</#if>\n\n										<div class=\"text-truncate-inline\">\n											<a href=\"${(entryUserURL?? && validator.isNotNull(entryUserURL))?then(entryUserURL, \"\")}\" class=\"text-truncate username\">${curBlogEntry.getUserName()}</a>\n										</div>\n\n										<div>\n											${dateUtil.getDate(curBlogEntry.getStatusDate(), \"dd MMM\", locale)}\n\n											<#if blogsPortletInstanceConfiguration.enableReadingTime()>\n												- <@liferay_reading_time[\"reading-time\"] displayStyle=\"simple\" model=curBlogEntry />\n											</#if>\n\n											<#if serviceLocator??>\n												<#assign\n													assetEntryLocalService = serviceLocator.findService(\"com.liferay.asset.kernel.service.AssetEntryLocalService\")\n\n													assetEntry = assetEntryLocalService.getEntry(\"com.liferay.blogs.model.BlogsEntry\", curBlogEntry.getEntryId())\n												/>\n\n												<#if blogsPortletInstanceConfiguration.enableViewCount()>\n													- <@liferay_ui[\"message\"] arguments=assetEntry.getViewCount() key=(assetEntry.getViewCount()==0)?then(\"x-view\", \"x-views\") />\n												</#if>\n											</#if>\n										</div>\n									</div>\n								</div>\n							</div>\n						</div>\n\n						<#if cardImage>\n							<p class=\"widget-resume\">${stringUtil.shorten(htmlUtil.stripHtml(curBlogEntry.getContent()), 150)}</p>\n						<#else>\n							<p class=\"widget-resume\">${stringUtil.shorten(htmlUtil.stripHtml(curBlogEntry.getContent()), 400)}</p>\n						</#if>\n					</div>\n\n					<div class=\"card-footer\">\n						<div class=\"card-row\">\n							<div class=\"autofit-float autofit-row autofit-row-center widget-toolbar\">\n								<#if blogsPortletInstanceConfiguration.enableComments()>\n									<div class=\"autofit-col\">\n										<#assign viewCommentsPortletURL = renderResponse.createRenderURL() />\n\n										${viewCommentsPortletURL.setParameter(\"mvcRenderCommandName\", \"/blogs/view_entry\")}\n										${viewCommentsPortletURL.setParameter(\"scroll\", renderResponse.getNamespace() + \"discussionContainer\")}\n\n										<#if validator.isNotNull(curBlogEntry.getUrlTitle())>\n											${viewCommentsPortletURL.setParameter(\"urlTitle\", curBlogEntry.getUrlTitle())}\n										<#else>\n											${viewCommentsPortletURL.setParameter(\"entryId\", curBlogEntry.getEntryId()?string)}\n										</#if>\n\n										<a class=\"btn btn-outline-borderless btn-outline-secondary btn-sm\" href=\"${viewCommentsPortletURL.toString()}\">\n											<span class=\"inline-item inline-item-before\">\n												<@clay[\"icon\"] symbol=\"comments\" />\n											</span> ${commentManager.getCommentsCount(\"com.liferay.blogs.model.BlogsEntry\", curBlogEntry.getEntryId())}\n										</a>\n									</div>\n								</#if>\n\n								<#if blogsPortletInstanceConfiguration.enableRatings()>\n									<div class=\"autofit-col\">\n										<@liferay_ui[\"ratings\"]\n											className=\"com.liferay.blogs.model.BlogsEntry\"\n											classPK=curBlogEntry.getEntryId()\n										/>\n									</div>\n								</#if>\n\n								<div class=\"autofit-col autofit-col-end\">\n									<#assign bookmarkURL = renderResponse.createRenderURL() />\n\n									${bookmarkURL.setWindowState(windowStateFactory.getWindowState(\"NORMAL\"))}\n									${bookmarkURL.setParameter(\"mvcRenderCommandName\", \"/blogs/view_entry\")}\n\n									<#if validator.isNotNull(curBlogEntry.getUrlTitle())>\n										${bookmarkURL.setParameter(\"urlTitle\", curBlogEntry.getUrlTitle())}\n									<#else>\n										${bookmarkURL.setParameter(\"entryId\", curBlogEntry.getEntryId()?string)}\n									</#if>\n\n									<@liferay_social_bookmarks[\"bookmarks\"]\n										className=\"com.liferay.blogs.model.BlogsEntry\"\n										classPK=curBlogEntry.getEntryId()\n										maxInlineItems=0\n										target=\"_blank\"\n										title=blogsEntryUtil.getDisplayTitle(resourceBundle, curBlogEntry)\n										types=blogsPortletInstanceConfiguration.socialBookmarksTypes()\n										url=portalUtil.getCanonicalURL(bookmarkURL.toString(), themeDisplay, themeDisplay.getLayout())\n									/>\n								</div>\n							</div>\n						</div>\n					</div>\n				</div>\n			</div>\n		</#list>\n	</#if>\n</div>',0,0,24087,NULL,NULL),('a0af403e-7969-cf29-bcd1-78ee26454130',24090,20135,20099,20103,NULL,20103,NULL,'2018-09-20 18:17:07.939000','2018-10-16 20:59:28.600000',24089,0,24032,'BREADCRUMB-ARROWS-FTL','1.1','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,fi_FI,zh_CN,es_ES,iw_IL,pt_BR,ja_JP,fr_FR,ca_ES,nl_NL,hu_HU,de_DE\" default-locale=\"en_US\"><Name language-id=\"en_US\">Arrows</Name><Name language-id=\"ca_ES\">Fletxes</Name><Name language-id=\"zh_CN\">箭头</Name><Name language-id=\"nl_NL\">Pijlen</Name><Name language-id=\"fi_FI\">Nuolet</Name><Name language-id=\"fr_FR\">Flèches</Name><Name language-id=\"de_DE\">Pfeile</Name><Name language-id=\"iw_IL\">חצים</Name><Name language-id=\"hu_HU\">Nyilak</Name><Name language-id=\"ja_JP\">矢印</Name><Name language-id=\"pt_BR\">Setas</Name><Name language-id=\"es_ES\">Flechas</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,fi_FI,zh_CN,es_ES,iw_IL,pt_BR,ja_JP,fr_FR,ca_ES,nl_NL,hu_HU,de_DE\" default-locale=\"en_US\"><Description language-id=\"en_US\">Displays a breadcrumb in which every navigation element is represented by an arrow with its title and link.</Description><Description language-id=\"ca_ES\">Mostra una ruta de navegació en què cada element de navegació es representa amb una fletxa amb el seu títol i enllaç.</Description><Description language-id=\"zh_CN\">显示一个面包屑导航，其中每一个导航元素都由箭头及其标题和链接表示。</Description><Description language-id=\"nl_NL\">Geeft een broodkruimel weer waarin elk navigatie-element voorgesteld wordt door een pijl met een titel en link.</Description><Description language-id=\"fi_FI\">Näyttää murupolun, jossa jokainen navigointielementti näkyy nuolena otsikkoineen ja linkkinä.</Description><Description language-id=\"fr_FR\">Affiche un fil d\'Ariane dans lequel chaque élément de navigation est représenté par une flèche avec son propre titre et son propre lien.</Description><Description language-id=\"de_DE\">Zeigt eine Breadcrumbnavigation an, bei der jedes Navigationselement durch einen Pfeil mit seinem Titel und einem Link dargestellt wird.</Description><Description language-id=\"iw_IL\">מציג את פירורי הלחם בהם כל אלמנט ניווט מיוצג על-ידי חץ עם הכותרת והקישור שלו.</Description><Description language-id=\"hu_HU\">Megjelenít egy úrkövetőt, amelyen minden navigációs elemet egy nyíl képvisel címmel és hivatkozással tartalmaz.</Description><Description language-id=\"ja_JP\">すべてのナビゲーション要素が矢印とタイトル、リンクで表示されるように、パンくずリストを表示します。</Description><Description language-id=\"pt_BR\">Exibe um caminho de navegação onde cada elemento de navegação é representado por uma seta com seu título e link.</Description><Description language-id=\"es_ES\">Muestra una ruta de navegación donde cada elemento de navegación se representa mediante una flecha con su título y enlace.</Description></root>','display',NULL,'ftl','<#if entries?has_content>\n	<@liferay_util[\"html-top\"]>\n		<style>\n			.breadcrumb-arrows li {\n				background-color: #EFEFEF;\n				margin-bottom: 3px;\n				overflow: visible;\n			}\n\n			.breadcrumb-arrows li + li::before {\n				content: none;\n			}\n\n			.breadcrumb-arrows li > a {\n				border-right: 4px solid #FFF;\n				display: block;\n				max-width: 100%;\n				position: relative;\n			}\n\n			.breadcrumb-arrows .entry {\n				line-height: 40px;\n				overflow: hidden;\n				padding-left: 30px;\n				padding-right: 7px;\n				text-overflow: ellipsis;\n				white-space: nowrap;\n			}\n\n			.breadcrumb-arrows a::after {\n				border-bottom: 20px inset transparent;\n				border-left: 20px solid #EFEFEF;\n				border-top: 20px inset transparent;\n				content: \'\';\n				height: 0;\n				position: absolute;\n				right: -20px;\n				top: 0;\n				width: 0;\n				z-index: 2;\n			}\n\n			.breadcrumb-arrows li:nth-child(n+2) a::before {\n				border-bottom: 20px inset transparent;\n				border-left: 20px solid #FFF;\n				border-top: 20px inset transparent;\n				content: \'\';\n				height: 0;\n				left: 0;\n				position: absolute;\n				top: 0;\n				width: 0;\n			}\n\n			.breadcrumb-arrows li:last-child {\n				border-bottom-right-radius: 4px;\n				border-right-width: 0;\n				border-top-right-radius: 4px;\n				position: relative;\n			}\n\n			.breadcrumb-arrows li:last-child::before {\n				border-bottom: 20px inset transparent;\n				border-left: 20px solid #FFF;\n				border-top: 20px inset transparent;\n				content: \'\';\n				height: 0;\n				left: 0;\n				position: absolute;\n				top: 0;\n				width: 0;\n			}\n\n			.breadcrumb-arrows li:last-child .entry {\n				padding-right: 23px;\n			}\n\n			.breadcrumb-arrows li:first-child {\n				border-bottom-left-radius: 4px;\n				border-top-left-radius: 4px;\n			}\n\n			.breadcrumb-arrows li:first-child::before {\n				border-left-width: 0;\n			}\n\n			.breadcrumb-arrows li:first-child .entry {\n				padding-left: 23px;\n			}\n\n			.breadcrumb-arrows .active {\n				background-color: #007ACC;\n			}\n\n			.breadcrumb-arrows .active a, .breadcrumb-arrows .active .entry {\n				color: #FFF;\n			}\n\n			.breadcrumb-arrows .active a::after {\n				border-left-color: #007ACC;\n			}\n\n			.portlet-barebone .breadcrumb-arrows li > a, .portlet-borderless .breadcrumb-arrows li > a, .taglib-portlet-preview .breadcrumb-arrows li > a {\n				border-right-color: #F5F7F8;\n			}\n\n			.portlet-barebone .breadcrumb-arrows li:last-child::before, .portlet-barebone .breadcrumb-arrows li:nth-child(n+2) a::before, .portlet-borderless .breadcrumb-arrows li:last-child::before, .portlet-borderless .breadcrumb-arrows li:nth-child(n+2) a::before, .taglib-portlet-preview .breadcrumb-arrows li:last-child::before, .taglib-portlet-preview .breadcrumb-arrows li:nth-child(n+2) a::before {\n				border-left-color: #F5F7F8;\n			}\n		</style>\n	</@>\n\n	<div aria-label=\"${portletDisplay.getTitle()}\" class=\"breadcrumb breadcrumb-arrows\" role=\"navigation\">\n		<#assign cssClass = \"\" />\n\n		<#list entries as entry>\n			<#if entry?is_last>\n				<#assign cssClass = \"active\" />\n			</#if>\n\n			<li class=\"${cssClass}\" <#if entry?is_last>aria-current=\"page\"</#if>>\n				<#if entry?has_next>\n					<a\n\n					<#if entry.isBrowsable()>\n						href=\"${entry.getURL()!\"\"}\"\n					</#if>\n\n					>\n				</#if>\n\n				<div class=\"entry\">\n					${htmlUtil.escape(entry.getTitle())}\n				</div>\n\n				<#if entry?has_next>\n					</a>\n				</#if>\n			</li>\n		</#list>\n	</div>\n</#if>',0,0,24091,NULL,NULL),('80f91050-9895-0f0f-03a8-a8f05af16d25',24093,20135,20099,20103,NULL,20103,NULL,'2018-09-20 18:17:07.947000','2018-10-16 20:59:28.626000',24089,0,24032,'BREADCRUMB-HORIZONTAL-FTL','1.1','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,fi_FI,zh_CN,es_ES,iw_IL,pt_BR,ja_JP,fr_FR,ca_ES,nl_NL,hu_HU,de_DE\" default-locale=\"en_US\"><Name language-id=\"en_US\">Horizontal</Name><Name language-id=\"ca_ES\">Horitzontal</Name><Name language-id=\"zh_CN\">水平</Name><Name language-id=\"nl_NL\">Horizontaal</Name><Name language-id=\"fi_FI\">Vaakasuuntainen</Name><Name language-id=\"fr_FR\">Horizontal</Name><Name language-id=\"de_DE\">Horizontal</Name><Name language-id=\"iw_IL\">אופקי</Name><Name language-id=\"hu_HU\">Vízszintes</Name><Name language-id=\"ja_JP\">水平方向</Name><Name language-id=\"pt_BR\">Horizontal</Name><Name language-id=\"es_ES\">Horizontal</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,fi_FI,zh_CN,es_ES,iw_IL,pt_BR,ja_JP,fr_FR,ca_ES,nl_NL,hu_HU,de_DE\" default