INSERT INTO `DDMTemplateVersion` VALUES (24035,20135,20099,20103,NULL,'2018-09-20 18:17:07.539000',23502,0,24033,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,fi_FI,zh_CN,es_ES,iw_IL,pt_BR,ja_JP,fr_FR,ca_ES,nl_NL,hu_HU,de_DE\" default-locale=\"en_US\"><Name language-id=\"fi_FI\">Sosiaalinen</Name><Name language-id=\"en_US\">Social</Name><Name language-id=\"zh_CN\">社交</Name><Name language-id=\"es_ES\">Social</Name><Name language-id=\"iw_IL\">חברתי</Name><Name language-id=\"pt_BR\">Social</Name><Name language-id=\"ja_JP\">ソーシャル</Name><Name language-id=\"fr_FR\">Social</Name><Name language-id=\"ca_ES\">Social</Name><Name language-id=\"nl_NL\">Sociaal</Name><Name language-id=\"hu_HU\">Közösségi</Name><Name language-id=\"de_DE\">Social</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,fi_FI,zh_CN,es_ES,iw_IL,pt_BR,ja_JP,fr_FR,ca_ES,nl_NL,hu_HU,de_DE\" default-locale=\"en_US\"><Description language-id=\"fi_FI\">Näyttää sosiaaliset kirjanmerkit ja arvostelut wikisivuilla ja niiden alisivuilla.</Description><Description language-id=\"en_US\">Displays social bookmarks and ratings for wiki pages and their child pages.</Description><Description language-id=\"zh_CN\">显示社交书签和维基页的评分和它们的子页。</Description><Description language-id=\"es_ES\">Muestra los marcadores sociales y las clasificaciones para páginas wiki y sus páginas secundarias.</Description><Description language-id=\"iw_IL\">מציג סימניות חברתיות ודירוגים עבור דפי וויקי והדפים הבנים שלהם.</Description><Description language-id=\"pt_BR\">Exibe marcadores sociais e avaliações para páginas da wiki e suas páginas filhas.</Description><Description language-id=\"ja_JP\">Wikiページとそのサブページ用のソーシャルブックマークと評価を表示する</Description><Description language-id=\"fr_FR\">Affiche les signets sociaux and les notations pour page wiki et leur pages enfants.</Description><Description language-id=\"ca_ES\">Mostra adreces d\'interès socials i classificacions per a planes del wiki.</Description><Description language-id=\"nl_NL\">Geeft sociale favorieten en waarderingen van wikipagina\'s en onderliggende wikipagina\'s weer.</Description><Description language-id=\"hu_HU\">Megjeleníti a közösségi könyvjelzőket és értékeléseket a wiki oldalak és gyermek oldalaik részére.</Description><Description language-id=\"de_DE\">Darstellung für Social Bookmarks und Bewertungen von Wikiseiten und deren Unterseiten.</Description></root>','ftl','<#assign\n	wikiPageClassName = \"com.liferay.wiki.model.WikiPage\"\n\n	assetRenderer = assetEntry.getAssetRenderer()\n/>\n\n<div class=\"taglib-header\">\n	<h1 class=\"header-title\">${entry.getTitle()}</h1>\n</div>\n\n<div style=\"float: right;\">\n	<@getEditIcon />\n\n	<@getPageDetailsIcon />\n\n	<@getPrintIcon />\n</div>\n\n<div class=\"wiki-body\">\n	<div class=\"wiki-info\">\n		<span class=\"stats\">${assetEntry.getViewCount()} <@liferay.language key=\"views\" /></span> |\n\n		<span class=\"date\"><@liferay.language key=\"last-modified\" /> ${dateUtil.getDate(entry.getModifiedDate(), \"dd MMM yyyy - HH:mm:ss\", locale)}</span>\n\n		<span class=\"author\"><@liferay.language key=\"by\" /> ${htmlUtil.escape(portalUtil.getUserName(entry.getUserId(), entry.getUserName()))}</span>\n	</div>\n\n	<div class=\"wiki-content\">\n		<@liferay_social_bookmarks[\"bookmarks\"]\n			className=wikiPageClassName\n			classPK=entry.getResourcePrimKey()\n			displayStyle=\"normal\"\n			target=\"_blank\"\n			title=entry.getTitle()\n			url=viewURL\n		/>\n\n		${formattedContent}\n	</div>\n\n	<div class=\"page-actions\">\n		<div class=\"article-actions\">\n			<@getAddChildPageIcon />\n\n			<@getAttatchmentsIcon />\n		</div>\n	</div>\n\n	 <br />\n\n	<@getRatings\n		cssClass=\"page-ratings\"\n		entry=entry\n	/>\n\n	<@getRelatedAssets />\n</div>\n\n<div class=\"page-categorization\">\n	<div class=\"page-categories\">\n		<#assign viewCategorizedPagesURL = renderResponse.createRenderURL() />\n\n		${viewCategorizedPagesURL.setParameter(\"mvcRenderCommandName\", \"/wiki/view_categorized_pages\")}\n		${viewCategorizedPagesURL.setParameter(\"nodeId\", entry.getNodeId()?string)}\n\n		<@liferay_ui[\"asset-categories-summary\"]\n			className=wikiPageClassName\n			classPK=entry.getResourcePrimKey()\n			portletURL=viewCategorizedPagesURL\n		/>\n	</div>\n\n	<div class=\"page-tags\">\n		<#assign viewTaggedPagesURL = renderResponse.createRenderURL() />\n\n		${viewTaggedPagesURL.setParameter(\"mvcRenderCommandName\", \"/wiki/view_tagged_pages\")}\n		${viewTaggedPagesURL.setParameter(\"nodeId\", entry.getNodeId()?string)}\n\n		<@liferay_ui[\"asset-tags-summary\"]\n			className=wikiPageClassName\n			classPK=entry.getResourcePrimKey()\n			portletURL=viewTaggedPagesURL\n		/>\n	</div>\n</div>\n\n<#assign childPages = entry.getChildPages() />\n\n<#if (childPages?has_content)>\n	<div class=\"child-pages\">\n		<h2><@liferay.language key=\"children-pages\" /></h2>\n\n		<table class=\"taglib-search-iterator\">\n			<tr class=\"portlet-section-header results-header\">\n				<th>\n					<@liferay.language key=\"page\" />\n				</th>\n				<th>\n					<@liferay.language key=\"last-modified\" />\n				</th>\n				<th>\n					<@liferay.language key=\"ratings\" />\n				</th>\n			</tr>\n\n			<#list childPages as childPage>\n				<tr class=\"results-row\">\n					<#assign viewPageURL = renderResponse.createRenderURL() />\n\n					${viewPageURL.setParameter(\"mvcRenderCommandName\", \"/wiki/view\")}\n\n					<#assign childNode = childPage.getNode() />\n\n					${viewPageURL.setParameter(\"nodeName\", childNode.getName())}\n					${viewPageURL.setParameter(\"title\", childPage.getTitle())}\n\n					<td>\n						<a href=\"${viewPageURL}\">${childPage.getTitle()}</a>\n					</td>\n					<td>\n						<a href=\"${viewPageURL}\">${dateUtil.getDate(childPage.getModifiedDate(),\"dd MMM yyyy - HH:mm:ss\", locale)} <@liferay.language key=\"by\" /> ${htmlUtil.escape(portalUtil.getUserName(childPage.getUserId(), childPage.getUserName()))}</a>\n					</td>\n					<td>\n						<@getRatings\n							cssClass=\"child-ratings\"\n							entry=childPage\n						/>\n					</td>\n				</tr>\n			</#list>\n		</table>\n	</div>\n</#if>\n\n<@getDiscussion />\n\n<#macro getAddChildPageIcon>\n	<#if assetRenderer.hasEditPermission(themeDisplay.getPermissionChecker())>\n		<#assign addPageURL = renderResponse.createRenderURL() />\n\n		${addPageURL.setParameter(\"mvcRenderCommandName\", \"/wiki/edit_page\")}\n		${addPageURL.setParameter(\"redirect\", currentURL)}\n		${addPageURL.setParameter(\"nodeId\", entry.getNodeId()?string)}\n		${addPageURL.setParameter(\"title\", \"\")}\n		${addPageURL.setParameter(\"editTitle\", \"1\")}\n		${addPageURL.setParameter(\"parentTitle\", entry.getTitle())}\n\n		<@liferay_ui[\"icon\"]\n			iconCssClass=\"icon-plus\"\n			label=true\n			message=\"add-child-page\"\n			url=addPageURL?string\n		/>\n	</#if>\n</#macro>\n\n<#macro getAttatchmentsIcon>\n	<#assign viewPageAttachmentsURL = renderResponse.createRenderURL() />\n\n	${viewPageAttachmentsURL.setParameter(\"mvcRenderCommandName\", \"/wiki/view_page_attachments\") }\n\n	<@liferay_ui[\"icon\"]\n		iconCssClass=\"icon-paperclip\"\n		label=true\n		message=\'${entry.getAttachmentsFileEntriesCount() + languageUtil.get(locale, \"attachments\")}\'\n		url=viewPageAttachmentsURL?string\n	/>\n</#macro>\n\n<#macro getDiscussion>\n	<#if validator.isNotNull(assetRenderer.getDiscussionPath()) && wikiPortletInstanceConfiguration.enableComments()>\n		<br />\n\n		<#assign discussionURL = renderResponse.createActionURL() />\n\n		${discussionURL.setParameter(\"javax.portlet.action\", \"/wiki/\" + assetRenderer.getDiscussionPath())}\n\n		<@liferay_comment[\"discussion\"]\n			className=wikiPageClassName\n			classPK=entry.getResourcePrimKey()\n			formAction=discussionURL?string\n			formName=\"fm2\"\n			ratingsEnabled=wikiPortletInstanceConfiguration.enableCommentRatings()\n			redirect=currentURL\n			subject=assetRenderer.getTitle(locale)\n			userId=assetRenderer.getUserId()\n		/>\n	</#if>\n</#macro>\n\n<#macro getEditIcon>\n	<#if assetRenderer.hasEditPermission(themeDisplay.getPermissionChecker())>\n		<#assign editPageURL = renderResponse.createRenderURL() />\n\n		${editPageURL.setParameter(\"mvcRenderCommandName\", \"/wiki/edit_page\")}\n		${editPageURL.setParameter(\"redirect\", currentURL)}\n		${editPageURL.setParameter(\"nodeId\", entry.getNodeId()?string)}\n		${editPageURL.setParameter(\"title\", entry.getTitle())}\n\n		<@liferay_ui[\"icon\"]\n			iconCssClass=\"icon-edit\"\n			message=entry.getTitle()\n			url=editPageURL?string\n		/>\n	</#if>\n</#macro>\n\n<#macro getPageDetailsIcon>\n	<#assign viewPageDetailsURL = renderResponse.createRenderURL() />\n\n	${viewPageDetailsURL.setParameter(\"mvcRenderCommandName\", \"/wiki/view_page_details\")}\n	${viewPageDetailsURL.setParameter(\"redirect\", currentURL)}\n\n	<@liferay_ui[\"icon\"]\n		iconCssClass=\"icon-file-alt\"\n		message=\"details\"\n		url=viewPageDetailsURL?string\n	/>\n</#macro>\n\n<#macro getPrintIcon>\n	<#assign printURL = renderResponse.createRenderURL() />\n\n	${printURL.setParameter(\"viewMode\", \"print\")}\n	${printURL.setWindowState(\"pop_up\")}\n\n	<#assign\n		title = languageUtil.format(locale, \"print-x-x\", [\"hide-accessible\", htmlUtil.escape(assetRenderer.getTitle(locale))], false)\n		taglibPrintURL = \"javascript:Liferay.Util.openWindow({dialog: {width: 960}, id:\'\" + renderResponse.getNamespace() + \"printAsset\', title: \'\" + title + \"\', uri: \'\" + htmlUtil.escapeURL(printURL.toString()) + \"\'});\"\n	/>\n\n	<@liferay_ui[\"icon\"]\n		iconCssClass=\"icon-print\"\n		message=\"print\"\n		url=taglibPrintURL\n	/>\n</#macro>\n\n<#macro getRatings\n	cssClass\n	entry\n>\n	<#if wikiPortletInstanceConfiguration.enablePageRatings()>\n		<div class=\"${cssClass}\">\n			<@liferay_ui[\"ratings\"]\n				className=wikiPageClassName\n				classPK=entry.getResourcePrimKey()\n			/>\n		</div>\n	</#if>\n</#macro>\n\n<#macro getRelatedAssets>\n	<#if assetEntry?? && wikiPortletInstanceConfiguration.enableRelatedAssets()>\n		<@liferay_ui[\"asset-links\"] assetEntryId=assetEntry.getEntryId() />\n	</#if>\n</#macro>',0,20103,NULL,'2018-09-20 18:17:07.539000'),(24039,20135,20099,20103,NULL,'2018-09-20 18:17:07.612000',24036,0,24037,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,fi_FI,zh_CN,es_ES,iw_IL,pt_BR,ja_JP,fr_FR,ca_ES,nl_NL,hu_HU,de_DE\" default-locale=\"en_US\"><Name language-id=\"fi_FI\">Navigointi</Name><Name language-id=\"en_US\">Navigation</Name><Name language-id=\"zh_CN\">导航</Name><Name language-id=\"es_ES\">Navegación</Name><Name language-id=\"iw_IL\">ניווט</Name><Name language-id=\"pt_BR\">Navegação</Name><Name language-id=\"ja_JP\">ナビゲーション</Name><Name language-id=\"fr_FR\">Navigation</Name><Name language-id=\"ca_ES\">Navegació</Name><Name language-id=\"nl_NL\">Navigatie</Name><Name language-id=\"hu_HU\">Navigáció</Name><Name language-id=\"de_DE\">Navigation</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,fi_FI,zh_CN,es_ES,iw_IL,pt_BR,ja_JP,fr_FR,ca_ES,nl_NL,hu_HU,de_DE\" default-locale=\"en_US\"><Description language-id=\"fi_FI\">Näyttää RSS-syötteet navigaatiopalkissa vasemmassa paneelissa. Klikkaamalla syötettä näytetään syötteen arvot oikeassa paneelissa.</Description><Description language-id=\"en_US\">Displays the RSS feeds as a navigation bar on the left panel. Clicking on a feed displays a list of feed entries on the right panel.</Description><Description language-id=\"zh_CN\">在左侧面板上显示RSS源的导航栏。在右侧面板上点击Feed显示提要条目的列表。</Description><Description language-id=\"es_ES\">Muestra las fuentes RSS como una barra de navegación del panel izquierdo. Al hacer clic en una fuente se muestra una lista de entradas de la fuente en el panel derecho.</Description><Description language-id=\"iw_IL\">מציג את הזנות ה-RSS כסרגל ניווט בחלונית השמאלית. לחיצה על הזנה מציגה רשימה של רשומות הזנה בחלונית הימנית.</Description><Description language-id=\"pt_BR\">Exibe os feeds RSS como uma barra de navegação no painel esquerdo. Clicar em um feed exibe uma lista de entradas de feed no painel direito.</Description><Description language-id=\"ja_JP\">RSSフィードを左のパネルにナビゲーションバーとして表示します。フィードをクリックすると、右パネルにフィードの内容がリスト表示されます</Description><Description language-id=\"fr_FR\">Affiche les flux RSS en tant que barre de navigation dans le panneau gauche. Cliquer sur un flux affiche une liste d\'entrées de flux sur le panneau droit.</Description><Description language-id=\"ca_ES\">Mostra els canals RSS com una barra de navegació en el tauler esquerra. Al fer un clic en un canal es mostraran la llista d\'entrades en el tauler dret.</Description><Description language-id=\"nl_NL\">Geeft de RSS-feeds als een navigatiebalk in het linkerpaneel weer. Als u op een feed klikt wordt een lijst van van feed-entries in het rechterpaneel getoond.</Description><Description language-id=\"hu_HU\">Megjeleníti az RSS hírcsatornákat navigációs oszlopként a bal oldalon. Egy hírcsatornára kattintva megjeleníti a hírcsatorna bejegyzések listáját a jobb oldalon.</Description><Description language-id=\"de_DE\">Stellt die RSS-Feeds als Navigationsleiste im linken Bereich dar. Nach Anklicken eines Feeds werden die entsprechenden Feedeinträge im rechten Bereich dargestellt.</Description></root>','ftl','<#assign rssPortletInstanceConfiguration = rssDisplayContext.getRSSPortletInstanceConfiguration() />\n\n<style>\n	.portlet-rss .feed-entry-content {\n		margin-bottom: 20px;\n		padding-left: 0;\n	}\n</style>\n\n<#if entries?has_content>\n	<#assign dateFormat = \"dd MMM yyyy - HH:mm:ss\" />\n\n	<div class=\"container-fluid\">\n		<div class=\"row\" id=\"<@portlet.namespace />feedsTab\">\n			<ul class=\"col-xs-4\">\n				<#list entries as curEntry>\n					<li><a href=\"#tab-${curEntry_index}\">${htmlUtil.escape(curEntry.getTitle())}</a></li>\n				</#list>\n			</ul>\n\n			<div class=\"col-xs-8 tab-content\">\n				<#list entries as curEntry>\n					<#assign rssFeedEntries = curEntry.getRSSFeedEntries(themeDisplay) />\n\n					<#if rssFeedEntries??>\n						<div class=\"tab-pane\" id=\"tab-${curEntry_index}\">\n							<#list rssFeedEntries as rssFeedEntry>\n								<#if (rssFeedEntry_index > entriesPerFeed?number)>\n									<#break>\n								</#if>\n\n								<#assign syndEntry = rssFeedEntry.getSyndEntry() />\n\n								<div class=\"feed-entry-content\">\n									<div class=\"feed-title\">\n										<@liferay_aui[\"a\"] href=\"${htmlUtil.escapeJSLink(rssFeedEntry.getSyndEntryLink())}\">${htmlUtil.escape(syndEntry.getTitle())}</@>\n									</div>\n\n									<#if rssPortletInstanceConfiguration.showFeedTitle() && syndEntry.getAuthor()??>\n										<div class=\"feed-entry-author\">\n											${htmlUtil.escape(syndEntry.getAuthor())}\n										</div>\n									</#if>\n\n									<#if syndEntry.getPublishedDate()??>\n										<div class=\"feed-date\">\n											<@liferay_ui[\"icon\"]\n												iconCssClass=\"icon-calendar\"\n												label=true\n												message=\"${dateUtil.getDate(syndEntry.getPublishedDate(), dateFormat, locale)}\"\n											/>\n										</div>\n									</#if>\n\n									${rssFeedEntry.getSanitizedContent()}\n								</div>\n							</#list>\n						</div>\n					</#if>\n				</#list>\n			</div>\n		</div>\n	</div>\n\n	<@liferay_aui[\"script\"] use=\"aui-base,aui-tabview\">\n		new A.TabView(\n			{\n				srcNode: \'#<@portlet.namespace />feedsTab\',\n				stacked: true,\n				type: \'pills\'\n			}\n		).render();\n	</@>\n</#if>',0,20103,NULL,'2018-09-20 18:17:07.612000'),(24042,20135,20099,20103,NULL,'2018-09-20 18:17:07.641000',20013,0,24040,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,fi_FI,zh_CN,es_ES,iw_IL,pt_BR,ja_JP,fr_FR,ca_ES,nl_NL,hu_HU,de_DE\" default-locale=\"en_US\"><Name language-id=\"fi_FI\">Usean sarakkeen asettelu</Name><Name language-id=\"en_US\">Multi Column Layout</Name><Name language-id=\"zh_CN\">多列布局</Name><Name language-id=\"es_ES\">Diseño con varias columnas</Name><Name language-id=\"iw_IL\">תצורה מרובת עמודות</Name><Name language-id=\"pt_BR\">Layout em Múltiplas Colunas</Name><Name language-id=\"ja_JP\">複数カラムレイアウト</Name><Name language-id=\"fr_FR\">Mise en page multi-colonne</Name><Name language-id=\"ca_ES\">Plana multi-columna</Name><Name language-id=\"nl_NL\">Lay-out met meerdere kolommen</Name><Name language-id=\"hu_HU\">Több oszlopos elrendezés</Name><Name language-id=\"de_DE\">Multi-Spalten-Layout</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,fi_FI,zh_CN,es_ES,iw_IL,pt_BR,ja_JP,fr_FR,ca_ES,nl_NL,hu_HU,de_DE\" default-locale=\"en_US\"><Description language-id=\"fi_FI\">Näyttää sarakkeen jokaiselle sanastolle. Jokainen sarake sisältää sanaston nimen, missä sanaston ylätason luokitukset on listattu.</Description><Description language-id=\"en_US\">Displays a column for each vocabulary. Each column includes the name of a vocabulary with the vocabulary\'s top level categories listed underneath.</Description><Description language-id=\"zh_CN\">显示一列中的每个词汇，每列包括顶级类别之下的词汇名字。</Description><Description language-id=\"es_ES\">Despliega una columna para cada vocabulario. Cada columna incluye el nombre de un vocabulario con las categorías de mayor nivel del vocabulario listadas debajo.</Description><Description language-id=\"iw_IL\">מציג עמודה עבור כל אוצר מילים. כל עמודה מכילה את השם של אוצר מילים ומתחתיו הקטגוריות ברמת העל.</Description><Description language-id=\"pt_BR\">Exibe uma coluna para cada vocabulário. Cada coluna inclui o nome do vocabulário com as categorias de nível mais alto listadas abaixo dele.</Description><Description language-id=\"ja_JP\">各ボキャブラリ用に列を表示する。各列は以下にリストになっている、最上位に設定されている用語名を含んでいます</Description><Description language-id=\"fr_FR\">Affiche une colonne pour chaque vocabulaire. Chaque colonne inclut le nom d\'un vocabulaire avec les catégories du niveau racine listées en dessous.</Description><Description language-id=\"ca_ES\">Visualitza una columna per a cada vocabulari. Cada columna inclou el nom del vocabulari amb la categoria de nivell més alta a sota.</Description><Description language-id=\"nl_NL\">Toon een kolom voor ieder woordenboek. Iedere kolom bevat de naam van een woordenboek met de hoofd categorieën eronder.</Description><Description language-id=\"hu_HU\">Megjelenít egy oszlopot minden szótár számára. Minden oszlop tartalmazza a szótár nevét, alatta a szótár felső szintű kategóriáival.</Description><Description language-id=\"de_DE\">Stellt eine Spalte für jedes Vokabular dar. Jede Spalte enthält den Namen eines Vokabulars mit der obersten Kategorienebene darunter.</Description></root>','ftl','<#if entries?has_content>\n	<@liferay_aui.row>\n		<#list entries as entry>\n			<@liferay_aui.col width=25>\n				<div class=\"results-header\">\n					<h3>\n						${entry.getUnambiguousTitle(entries, themeDisplay.getSiteGroupId(), themeDisplay.getLocale())}\n					</h3>\n				</div>\n\n				<#assign categories = entry.getCategories() />\n\n				<@displayCategories categories=categories />\n			</@liferay_aui.col>\n		</#list>\n	</@liferay_aui.row>\n</#if>\n\n<#macro displayCategories\n	categories\n>\n	<#if categories?has_content>\n		<ul class=\"categories\">\n			<#list categories as category>\n				<li>\n					<#assign categoryURL = renderResponse.createRenderURL() />\n\n					${categoryURL.setParameter(\"resetCur\", \"true\")}\n					${categoryURL.setParameter(\"categoryId\", category.getCategoryId()?string)}\n\n					<a href=\"${categoryURL}\">${category.getName()}</a>\n\n					<#if serviceLocator??>\n						<#assign\n							assetCategoryService = serviceLocator.findService(\"com.liferay.asset.kernel.service.AssetCategoryService\")\n\n							childCategories = assetCategoryService.getChildCategories(category.getCategoryId())\n						/>\n\n						<@displayCategories categories=childCategories />\n					</#if>\n				</li>\n			</#list>\n		</ul>\n	</#if>\n</#macro>',0,20103,NULL,'2018-09-20 18:17:07.641000'),(24046,20135,20099,20103,NULL,'2018-09-20 18:17:07.676000',24043,0,24044,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,fi_FI,zh_CN,es_ES,iw_IL,pt_BR,ja_JP,fr_FR,ca_ES,nl_NL,hu_HU,de_DE\" default-locale=\"en_US\"><Name language-id=\"fi_FI\">Luettelovalikko</Name><Name language-id=\"en_US\">List Menu</Name><Name language-id=\"zh_CN\">列表菜单</Name><Name language-id=\"es_ES\">Menú de lista</Name><Name language-id=\"iw_IL\">תפריט רשימות</Name><Name language-id=\"pt_BR\">Menu de lista</Name><Name language-id=\"ja_JP\">リスト メニュー</Name><Name language-id=\"fr_FR\">Menu de Liste</Name><Name language-id=\"ca_ES\">Menú de llista</Name><Name language-id=\"nl_NL\">Lijstmenu</Name><Name language-id=\"hu_HU\">Lista menü</Name><Name language-id=\"de_DE\">Listenmenü</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,fi_FI,zh_CN,es_ES,iw_IL,pt_BR,ja_JP,fr_FR,ca_ES,nl_NL,hu_HU,de_DE\" default-locale=\"en_US\"><Description language-id=\"fi_FI\">Näyttää navigointivalikon luettelolla.</Description><Description language-id=\"en_US\">Displays a navigation menu with a list.</Description><Description language-id=\"zh_CN\">显示带有列表的导航菜单。</Description><Description language-id=\"es_ES\">Muestra un menú de navegación con una lista.</Description><Description language-id=\"iw_IL\">מציג תפריט ניווט עם רשימה.</Description><Description language-id=\"pt_BR\">Exibe um menu de navegação com uma lista.</Description><Description language-id=\"ja_JP\">ナビゲーションメニューをリストで表示します</Description><Description language-id=\"fr_FR\">Affiche un menu de navigation avec une liste.</Description><Description language-id=\"ca_ES\">Mostra un menú de navegació amb una llista.</Description><Description language-id=\"nl_NL\">Geeft een navigatiemenu weer met een lijst.</Description><Description language-id=\"hu_HU\">Megjelenít egy navigációs menüt egy listával.</Description><Description language-id=\"de_DE\">Zeigt ein Navigationsmenü mit einer Liste.</Description></root>','ftl','<#include \"${templatesPath}/NAVIGATION-MACRO-FTL\" />\n\n<#if !entries?has_content>\n	<#if themeDisplay.isSignedIn()>\n		<div class=\"alert alert-info\">\n			<@liferay.language key=\"there-are-no-menu-items-to-display\" />\n		</div>\n	</#if>\n<#else>\n	<#assign includeAllChildNavItems = false />\n\n	<#if stringUtil.equals(includedLayouts, \"all\")>\n		<#assign includeAllChildNavItems = true />\n	</#if>\n\n	<div aria-label=\"<@liferay.language key=\"site-pages\" />\" class=\"list-menu\">\n		<@buildNavigation\n			branchNavItems=branchNavItems\n			cssClass=\"layouts\"\n			displayDepth=displayDepth\n			includeAllChildNavItems=includeAllChildNavItems\n			navItemLevel=1\n			navItems=entries\n		/>\n	</div>\n</#if>',0,20103,NULL,'2018-09-20 18:17:07.676000'),(24049,20135,20099,20103,NULL,'2018-09-20 18:17:07.702000',24043,0,24047,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,fi_FI,zh_CN,es_ES,iw_IL,pt_BR,ja_JP,fr_FR,ca_ES,nl_NL,hu_HU,de_DE\" default-locale=\"en_US\"><Name language-id=\"fi_FI\">Pills Vaakasuunta</Name><Name language-id=\"en_US\">Pills Horizontal</Name><Name language-id=\"zh_CN\">Pills Horizontal</Name><Name language-id=\"es_ES\">Globos horizontales</Name><Name language-id=\"iw_IL\">גלולות אופקי</Name><Name language-id=\"pt_BR\">Pills Horizontal</Name><Name language-id=\"ja_JP\">水平方向のピル形式</Name><Name language-id=\"fr_FR\">Pilules horizontales</Name><Name language-id=\"ca_ES\">Càpsules horitzontals</Name><Name language-id=\"nl_NL\">Horizontale pillen</Name><Name language-id=\"hu_HU\">Vízszintes tabletták</Name><Name language-id=\"de_DE\">Pills horizontal</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,fi_FI,zh_CN,es_ES,iw_IL,pt_BR,ja_JP,fr_FR,ca_ES,nl_NL,hu_HU,de_DE\" default-locale=\"en_US\"><Description language-id=\"fi_FI\">Näyttää navigointivalikon navigointikohteet pillereinä.</Description><Description language-id=\"en_US\">Displays a navigation menu with navigation items shown as pills.</Description><Description language-id=\"zh_CN\">显示导航菜单，其中导航项显示为药丸。</Description><Description language-id=\"es_ES\">Muestra un menú de navegación con elementos de navegación que se muestran como globos.</Description><Description language-id=\"iw_IL\">מציג תפריט ניווט עם פריטי ניווט המוצגים כמו גלולות.</Description><Description language-id=\"pt_BR\">Exibe um menu de navegação com itens de navegação exibidos como pills.</Description><Description language-id=\"ja_JP\">ピル形式でナビゲーションメニューを表示します。</Description><Description language-id=\"fr_FR\">Affiche un menu de navigation dont les éléments sont affichés sous la forme de pilules.</Description><Description language-id=\"ca_ES\">Mostra un menú de navegació amb elements de navegació que es mostren com a càpsules.</Description><Description language-id=\"nl_NL\">Geeft een navigatiemenu weer met navigatie-items in de vorm van pillen.</Description><Description language-id=\"hu_HU\">Megjelenít egy navigációs menüt tablettákként megjelenített navigációs elemekkel.</Description><Description language-id=\"de_DE\">Zeigt ein Navigationsmenü mit Navigationselementen als Pills an.</Description></root>','ftl','<#if !entries?has_content>\n	<#if themeDisplay.isSignedIn()>\n		<div class=\"alert alert-info\">\n			<@liferay.language key=\"there-are-no-menu-items-to-display\" />\n		</div>\n	</#if>\n<#else>\n	<#assign\n		portletDisplay = themeDisplay.getPortletDisplay()\n\n		navbarId = \"navbar_\" + portletDisplay.getId()\n	/>\n\n	<div id=\"${navbarId}\">\n		<ul aria-label=<@liferay.language key=\"site-pages\" />\" class=\"nav nav-pills navbar-site\" role=\"menubar\">\n			<#assign navItems = entries />\n\n			<#list navItems as navItem>\n				<#assign showChildren = (displayDepth != 1) && navItem.hasBrowsableChildren() />\n\n				<#if navItem.isBrowsable() || showChildren>\n					<#assign\n						nav_item_attr_has_popup = \"\"\n						nav_item_caret = \"\"\n						nav_item_css_class = \"lfr-nav-item nav-item\"\n						nav_item_href_link = \"\"\n						nav_item_link_css_class = \"nav-link text-truncate\"\n					/>