image=entry.getW3cLanguageId()?lower_case\n				markupView=\"lexicon\"\n				message=entry.getLongDisplayName()\n				url=entry.getURL()\n			/>\n		</#if>\n	</#list>\n</#if>',0,20103,NULL,'2018-09-20 18:17:08.003000'),(24109,20135,20099,20103,NULL,'2018-09-20 18:17:08.032000',24103,0,24107,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,fi_FI,zh_CN,es_ES,iw_IL,pt_BR,ja_JP,fr_FR,ca_ES,nl_NL,hu_HU,de_DE\" default-locale=\"en_US\"><Name language-id=\"fi_FI\">Kuvakevalikko</Name><Name language-id=\"en_US\">Icon Menu</Name><Name language-id=\"zh_CN\">图标菜单</Name><Name language-id=\"es_ES\">Menú de icono</Name><Name language-id=\"iw_IL\">תפריט סמלים</Name><Name language-id=\"pt_BR\">Menu de ícones</Name><Name language-id=\"ja_JP\">アイコン メニュー</Name><Name language-id=\"fr_FR\">Menu d\'icônes</Name><Name language-id=\"ca_ES\">Menú d\'icones</Name><Name language-id=\"nl_NL\">Pictogrammenu</Name><Name language-id=\"hu_HU\">Ikon menü</Name><Name language-id=\"de_DE\">Symbolmenü</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,fi_FI,zh_CN,es_ES,iw_IL,pt_BR,ja_JP,fr_FR,ca_ES,nl_NL,hu_HU,de_DE\" default-locale=\"en_US\"><Description language-id=\"fi_FI\">Näyttää valittuihin kieliin liittyvän kuvakevalikon.</Description><Description language-id=\"en_US\">Displays an icon menu with the selected languages.</Description><Description language-id=\"zh_CN\">显示带有选定语言的图标菜单。</Description><Description language-id=\"es_ES\">Muestra un menú de icono con los idiomas seleccionados.</Description><Description language-id=\"iw_IL\">הצגת תפריט סמלים עם השפות שנבחרו.</Description><Description language-id=\"pt_BR\">Exibe um menu de ícone com os idiomas selecionados.</Description><Description language-id=\"ja_JP\">選択した言語のアイコンメニューを表示します。</Description><Description language-id=\"fr_FR\">Affiche un menu d\'icônes avec les langues sélectionnées.</Description><Description language-id=\"ca_ES\">Mostra una icona de menú amb els idiomes seleccionats.</Description><Description language-id=\"nl_NL\">Geeft een pictogrammenu weer met de geselecteerde talen.</Description><Description language-id=\"hu_HU\">Megjelenít egy ikonmenüt a kiválasztott nyelvekkel.</Description><Description language-id=\"de_DE\">Zeigt ein Symbolmenü mit den ausgewählten Sprachen.</Description></root>','ftl','<#if entries?has_content>\n	<#assign normalizedDefaultLanguageId = stringUtil.toLowerCase(stringUtil.replace(languageId, \"_\", \"-\")) />\n\n	<div class=\"truncate-text\">\n		<@liferay_ui[\"icon-menu\"]\n			direction=\"left-side\"\n			icon=normalizedDefaultLanguageId\n			markupView=\"lexicon\"\n			showWhenSingleIcon=true\n			triggerLabel=normalizedDefaultLanguageId\n			triggerType=\"button\"\n		>\n			<#list entries as entry>\n				<#if !entry.isSelected() && !entry.isDisabled()>\n					<#assign\n						entryLocale = entry.getLocale()\n\n						displayName = entry.getLongDisplayName() + \"-\" + entryLocale.getDisplayCountry(entryLocale)\n						normalizedDefaultLanguageId = stringUtil.toLowerCase(stringUtil.replace(entry.getLanguageId(), \"_\", \"-\"))\n					/>\n\n					<@liferay_ui[\"icon\"]\n						icon=normalizedDefaultLanguageId\n						iconCssClass=\"inline-item inline-item-before\"\n						markupView=\"lexicon\"\n						message=displayName\n						url=entry.getURL()\n					/>\n				</#if>\n			</#list>\n		</@>\n	</div>\n</#if>',0,20103,NULL,'2018-09-20 18:17:08.032000'),(24112,20135,20099,20103,NULL,'2018-09-20 18:17:08.040000',24103,0,24110,'1.0','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,fi_FI,zh_CN,es_ES,iw_IL,pt_BR,ja_JP,fr_FR,ca_ES,nl_NL,hu_HU,de_DE\" default-locale=\"en_US\"><Name language-id=\"fi_FI\">Pitkä Teksti</Name><Name language-id=\"en_US\">Long Text</Name><Name language-id=\"zh_CN\">长文本</Name><Name language-id=\"es_ES\">Texto largo</Name><Name language-id=\"iw_IL\">טקסט ארוך</Name><Name language-id=\"pt_BR\">Texto Longo</Name><Name language-id=\"ja_JP\">長いテキスト</Name><Name language-id=\"fr_FR\"