INSERT INTO `LayoutPrototype` VALUES (0,'dea13afd-8c2e-f27e-7adc-027b7aa88aaf',20160,20099,20103,NULL,'2018-09-20 18:16:43.806000','2018-09-20 18:16:43.806000','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,fi_FI,zh_CN,es_ES,iw_IL,pt_BR,ja_JP,fr_FR,ca_ES,nl_NL,hu_HU,de_DE\" default-locale=\"en_US\"><Name language-id=\"fi_FI\">Haku</Name><Name language-id=\"en_US\">Search</Name><Name language-id=\"zh_CN\">搜索</Name><Name language-id=\"es_ES\">Búsqueda</Name><Name language-id=\"iw_IL\">חפש</Name><Name language-id=\"pt_BR\">Busca</Name><Name language-id=\"ja_JP\">検索</Name><Name language-id=\"fr_FR\">Rechercher</Name><Name language-id=\"ca_ES\">Cerca</Name><Name language-id=\"nl_NL\">Zoeken</Name><Name language-id=\"hu_HU\">Keresés</Name><Name language-id=\"de_DE\">Suche</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,fi_FI,zh_CN,es_ES,iw_IL,pt_BR,ja_JP,fr_FR,ca_ES,nl_NL,hu_HU,de_DE\" default-locale=\"en_US\"><Description language-id=\"fi_FI\">Näytä hakutulokset oletusfacettisarjalla.</Description><Description language-id=\"en_US\">Display search results with a default set of facets.</Description><Description language-id=\"zh_CN\">通过默认Facet集显示搜索结果。</Description><Description language-id=\"es_ES\">Mostrar resultados de la búsqueda con un conjunto por defecto de facetas.</Description><Description language-id=\"iw_IL\">הצג תוצאות חיפוש עם ערכת ברירת מחדל של היבטים.</Description><Description language-id=\"pt_BR\">Exibir resultados de pesquisa com um conjunto de facetas padrão.</Description><Description language-id=\"ja_JP\">ファセットの既定のセットで検索結果を表示します。</Description><Description language-id=\"fr_FR\">Afficher les résultats de recherche avec un jeu de facettes par défaut.</Description><Description language-id=\"ca_ES\">Mostra els resultats de cerca amb un conjunt de facetes predeterminades.</Description><Description language-id=\"nl_NL\">Zoekresultaten met een standaard facettenset weergeven.</Description><Description language-id=\"hu_HU\">Megjeleníti a keresési eredményeket az alapértelmezett fazettakészlettel.</Description><Description language-id=\"de_DE\">Suchergebnisse mit einem standardmäßigen Facettenset anzeigen.</Description></root>',NULL,1),(0,'93a6cf2d-9c21-68e6-a809-1bc0c0050c26',36086,20099,20103,NULL,'2018-09-20 18:17:52.293000','2018-09-20 18:17:52.293000','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,fi_FI,zh_CN,es_ES,iw_IL,pt_BR,ja_JP,fr_FR,ca_ES,nl_NL,hu_HU,de_DE\" default-locale=\"en_US\"><Name language-id=\"fi_FI\">Wiki</Name><Name language-id=\"en_US\">Wiki</Name><Name language-id=\"zh_CN\">Wiki</Name><Name language-id=\"es_ES\">Wiki</Name><Name language-id=\"iw_IL\">ויקי</Name><Name language-id=\"pt_BR\">Wiki</Name><Name language-id=\"ja_JP\">Wiki</Name><Name language-id=\"fr_FR\">Wiki</Name><Name language-id=\"ca_ES\">Wiki</Name><Name language-id=\"nl_NL\">Wiki</Name><Name language-id=\"hu_HU\">Wiki</Name><Name language-id=\"de_DE\">Wiki</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,fi_FI,zh_CN,es_ES,iw_IL,pt_BR,ja_JP,fr_FR,ca_ES,nl_NL,hu_HU,de_DE\" default-locale=\"en_US\"><Description language-id=\"fi_FI\">Tee yhteistyötä jäsenten kanssa wikin kautta tällä sivulla. Tutustu aiheeseen liittyvään sisältöön tunnisteiden kautta ja siirry helposti ja nopeasti luokkien välillä.</Description><Description language-id=\"en_US\">Collaborate with members through the wiki on this page. Discover related content through tags, and navigate quickly and easily with categories.</Description><Description language-id=\"zh_CN\">通过此页的Wiki与成员协作。通过标签搜索相关的内容，快速导航、轻松的类别。</Description><Description language-id=\"es_ES\">Colabora con los miembros a través de la wiki en esta página. Descubre el contenido relacionado a través de etiquetas y navega rápida y fácilmente por las categorías.</Description><Description language-id=\"iw_IL\">שתפו פעולה עם חברים באמצעות הוויקי בדף זה. גלו תוכן קשור באמצעות תגיות ונווטו מהר ובקלות בין קטגוריות.</Description><Description language-id=\"pt_BR\">Colabore com os membros através do wiki nesta página. Descubra conteúdo relacionado através de etiquetas e navegue rápida e facilmente com as categorias.</Description><Description language-id=\"ja_JP\">このページのWikiを通じてメンバーとコラボレーションできます。タグを利用して関連するコンテンツを見つけたり、カテゴリを使って簡単に情報をたどることができます</Description><Description language-id=\"fr_FR\">Collaborez avec les membres par le bias de wiki sur cette page. Découvrez le contenu lié par le biais des tags et naviguez rapidement et facilement avec les catégories.</Description><Description language-id=\"ca_ES\">Col·labora amb els membres a través de la wiki en aquesta pàgina. Descobreix el contingut relacionat a través d\'etiquetes i navega d\'una forma ràpida i fàcil amb les categories.</Description><Description language-id=\"nl_NL\">Werk samen met leden via de wiki op deze pagina. Ontdek verwante inhoud via tags en navigeer snel en eenvoudig met behulp van categorieën.</Description><Description language-id=\"hu_HU\">Működjön együtt a tagokkal az ezen az oldalon található wiki-n keresztül. Fedezzen fel kapcsolódó tartalmat címkékkel, és navigáljon gyorsan és könnyen kategóriákkal.</Description><Description language-id=\"de_DE\">Arbeiten Sie mit Hilfe des Wikis dieser Seite mit anderen Mitgliedern zusammen. Entdecken Sie in Verbindung stehende Inhalte über Tags und navigieren Sie schnell und einfach mit Kategorien.</Description></root>',NULL,1),(0,'d0714003-b98c-51fd-7d7a-7e58957d401a',36109,20099,20103,NULL,'2018-09-20 18:17:53.036000','2018-09-20 18:17:53.036000','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,fi_FI,zh_CN,es_ES,iw_IL,pt_BR,ja_JP,fr_FR,ca_ES,nl_NL,hu_HU,de_DE\" default-locale=\"en_US\"><Name language-id=\"fi_FI\">Blogit</Name><Name language-id=\"en_US\">Blog</Name><Name language-id=\"zh_CN\">博客</Name><Name language-id=\"es_ES\">Blog</Name><Name language-id=\"iw_IL\">בלוג</Name><Name language-id=\"pt_BR\">Blog</Name><Name language-id=\"ja_JP\">ブログ</Name><Name language-id=\"fr_FR\">Blogue</Name><Name language-id=\"ca_ES\">Bloc</Name><Name language-id=\"nl_NL\">Blog</Name><Name language-id=\"hu_HU\">Blog</Name><Name language-id=\"de_DE\">Blog</Name></root>','<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,fi_FI,zh_CN,es_ES,iw_IL,pt_BR,ja_JP,fr_FR,ca_ES,nl_NL,hu_HU,de_DE\" default-locale=\"en_US\"><Description language-id=\"fi_FI\">Luo, muokkaa ja näytä tämän sivun blogit. Selaa aiheita käytämällä tunnisteita ja tutustu muihin tämän blogin kirjoittajiin.</Description><Description language-id=\"en_US\">Create, edit, and view blogs from this page. Explore topics using tags, and connect with other members that blog.</Description><Description language-id=\"zh_CN\">在页面中创建，编辑并且预览博客。通便签导出主题，并也博客中的其他成员联系。</Description><Description language-id=\"es_ES\">Cree, edite y vea blogs desde esta página. Explore los temas usando etiquetas y conecte con otros miembros del blog.</Description><Description language-id=\"iw_IL\">צור, ערוך וצפה בבלוגים מעמוד זה. חקור נושאים באמצעות תגיות והתחבר עם חברים אחרים שכותבים בלוגים.</Description><Description language-id=\"pt_BR\">Crie, edite e visualize blogs a partir desta página. Explore tópicos utilizando tags e conecte-se a outros membros deste blog.</Description><Description language-id=\"ja_JP\">このページからブログの作成、編集、閲覧ができます。タグを使用して記事を検索したり、ブログの他のメンバーを結びつけることができます。</Description><Description language-id=\"fr_FR\">Créer, éditer et visualiser les blogs de cette page. Explorer les sujets en utilisant des tags et se connecter à d\'autres membres de ce blog.</Description><Description language-id=\"ca_ES\">Crear, editar i veure els blogs d\'aquesta pàgina. Explorar temes fent ús de les etiquetes i connectar-se amb altres membres d\'aquest blog.</Description><Description language-id=\"nl_NL\">Vanaf deze pagina kunt u blogs aanmaken, bewerken en bekijken. Ontdek onderwerpen aan de hand van tags, en verbind met andere leden die bloggen.</Description><Description language-id=\"hu_HU\">Hozz létre, szerkessz és tekints meg blogokat erről az oldalról. Fedezd fel a témákat a címkék segítségével és lépj kapcsolatba a többi blog taggal.</Description><Description language-id=\"de_DE\">Erstellen, bearbeiten und ansehen von Blogs dieser Seite. Erkunden Sie Themen mit Hilfe von Tags und verbinden Sie sich mit anderen Mitgliedern, die bloggen.</Description></root>',NULL,1);
